import React from 'react';
import './App.css';
import Footer from './components/Footer';
import { BrowserRouter as Router,Routes, Route, Link } from 'react-router-dom';
import UploadPage from './pages/UploadPage';
import ImagesPage from './pages/ImagesPage';
import ImagesAnnotationPage from './pages/ImagesAnnotationPage';
import Nopage from './pages/Nopage'; 

function App() {
  return (
    <Router>
      {/* <nav className='header-list'>
        <Link className = "header-list-items"to ="/images">Home</Link>
        <Link className = "header-list-items"to ="/images/upload">Uploaded Images</Link>
        <Link className = "header-list-items" to ="/images/view">Image Page</Link>
        <Link className = "header-list-items" to ="/images/edit/:id">Image Annotation Page</Link>

      </nav> */}
      <Routes>
        <Route path = "/images" element = {<UploadPage/>}/>
        <Route path = "/images/upload" element = {<UploadPage/>}/>
        <Route path = "/images/view" element = {<ImagesPage/>}/>
        <Route path="/images/edit/:id" element={<ImagesAnnotationPage />} />
        <Route path="*" element={<Nopage />} />
      </Routes>

      <Footer/>

    </Router>
  );
}

export default App;
